:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Allen Marsh and BUCHANAN, Annabelle Milne (Bella)
  JWILLIAMS, Edward Gordon and EMPSON, Judith Mary
  JWILLIAMS, Stephen Empson and FIRTH, Joyce Patricia
  01> WILLIAMS, Sarah Catherine
  b 08.04.1949
  Sarah b. at Sydney, Australia. Address: 5/179 Greenlane Road, Auckland 5.
  Sarah was educated at St Cuthbert's College (1954-66) and Auckland Technical Institute (Dip. Snr
  Business, 1967). She now has her own secretarial service business.
  03> WILLIAMS, Clemency Agnes Empson m on 20.07.1940 to RENNIE, James Maoate
  b 29.01.1914
  b 03.01.1915 d 07.05.1981
  Clemency b. at Otane, Hawkes Bay and m. at Wellington. James, s/o Frederickand Moeroa Rennie (who was
  s/o Capn James Rennie of Rarotonga, Cook Islands). Address: 30a Pentland Avenue, Mount Eden, Auckland.
  Clemency was educated at Woodford House and trained as a Karitane nurse. James was educated at Te Aute
  College and graduated from the Suva Medical School, Fiji in 1939. He joined the Medical Corps of the
  2nd NZEF and served in the 8th Army in the Middle East during WW2. In 1952 he graduated from the Royal
  College of Surgeons in Dublin then returned to New Zealand where he practised medicine.
  01> RENNIE, Linda Mary Moeroa m on 24.09.1966 to MINOGUE, Michael Wilfrid
  b 16.04.1941
  b 19.09.1945
  Linda b. at Waipawa and m, at Auckland. Michael b. at Auckland. Address: 10 Vincent Road,
  Northcote, Auckland 9; Email: mminogue@netbyte.co.nz.
  Linda is a clerk. Michael trained as a photolithographer and is now Technical Manager (Graphics).
  02> RENNIE, John David m on 13.05.1972 to SILKE, Cathleen Rachel
  b 12.09.1944
  b 25.09.1944
  John b. at Dunedin and m. at Motueka. Rachel, d/o Francis Silke and Cathleen Hermione (Mina)
  Stupples, b. at Nelson. Address: 2 Beatty Road, Matamata.
  John and Rachel are both teachers. John is presently deputy principal of Matamata Intermediate
  School.
  01> RENNIE, Sarah
  b 12.10.1974
  Sarah b. at Henderson. She was educated at Matamata College and was an American Field Scholar
  in Italy in 1992. She is presently in England. Address: Cricketers, Richmond Green, Richmond,
  Surrey, England TW9 ILX.
  02> RENNIE, Ben Maoate
  b 05.08.1980
  Ben b. at Henderson. He attended Matamata Intermediate School and is now in the seventh form at
  Matamata College. He is head boy at the school and he played in the 1st rugby XV team which
  won the World Tens Championship at Sydney in 1996.
  03> RENNIE, Christina m on 25.08.1979 to ANGELOV, Rossen Dimitrov
  b 26.06.1946
  b 07.01.1950
  Christina b. at Dunedin and m. at Sandanski, Bulgaria. Rossen, s/o Mitko Chorbov and Katya
  Shapkova, b. at Sandanski, Bulgaria. Address: 9 Warren Avenue, Three Kings, Auckland.
  Christina was educated at Whangarei Girls' High School and Auckland University (BA). She was a
  teacher of English as a second and foreign language in London (1969-79), Bulgaria (1971-72) and is
  now at Unitec Institute of Technology. Rossen was educated in Bulgaria at Plovdiv English
  Gymnasium, the Institute of International Tourism at Bourgas and Sofia University. He is a self
  employed businessman.
